import { queryAllByAltText } from "@testing-library/dom";
import axios from "axios";
import React from "react";
import Image from "./Image";
import { useEffect, useState } from "react";

export default function TableRow({ tableData, tableDisplay, key }) {
  const auth = "GVPDbDdKZe9uvSf5CPNjJ83BuhDEwWxQ6WDT50hiyd8";
  const [pic, setPic] = useState("");
  
 

  const handleClick = async function handleClick(name) {
    console.log("click");
    let query = name;
    const res = await axios.get(
      `https://api.unsplash.com/search/photos?page=1&query=${query}`,
      {
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
          Authorization:
            "Client-ID p00ZAeLxIZm2TTFsuNI-h9o-bW29x9rXd7bap4LUSOY",
        },
        params: {
          per_page: "1",
          content_filter: "high",
          // collections: 't_b6QAI_quY'
        },
      }
    );
    setPic(res.data.results[0].links.download);
    console.log(res);
  };

  const row = function row() {
    return tableData.slice(0, 20).map((el) => (
      <tr onClick={(e) => handleClick(el.comName)} className={el.comName}>
        <td colSpan="1">{el.comName}</td>
        <td colSpan="1">{el.sciName}</td>
        <td>{el.locName}</td>
        <td>{el.obsDt}</td>
      </tr>
    ));
  };

  return (
    
    <div>
      
      <thead>
        <tr>
          <th colSpan="1" scope="col">
            Common Name
          </th>
          <th colSpan="1" scope="col" data-label="Scientific Name">
            Scientific Name
          </th>
          <th colSpan="1">Location</th>
          <th colSpan="1">Date</th>
        </tr>
      </thead>
      <tbody>{row()}</tbody>
      <Image pic={pic}/>
    </div>
  );
}
